import React from 'react';
import styles from './Main.module.css';

function Main() {
    return (
        <div className={styles.container}>
            <h1>.WORKLOG</h1>
            <h3>타인이 바라 보는 나의 업무 성향을 파악하고 협업 스킬셋을 관리해보세요!</h3>
        </div>
    );
}

export default Main;
